import react from "react";
import "./App.css";
//import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <nav>
            <ul>
                <li>
                    <Link to="/home">Home</Link>
                </li>
                <li>
                    <Link to="/about">About</Link>
                </li>
                <li>
                    <Link to="/profile">Profile</Link>
                    <li>
                    <Link to="/writing">Writing</Link>
                </li>
                </li>
            </ul>
        </nav>
    )
}

export default Navbar;
